import { View, Text } from 'react-native'
import React from 'react'

export default function Signup() {
  return (
    <View>
      <Text style={{fontSize:20,fontFamily:'Urbanist-Bold'}}>Login</Text>
      <Text style={{fontSize:20,fontFamily:'Tinos-Italic'}}>Login</Text>
    </View>
  )
}
